import React, { Component } from "react";
import AxiosFunction from "../../Functions/AxiosFunctions";

export default class Players extends Component {
  async test() {
    (await AxiosFunction.get_favorite()).then(console.log("ddd"));
  }

  render() {
    // {console.log('ddd')}
    // await AxiosFunction.get_favorite().then(console.log('ddd'))
    this.test();
    return (
      <div>
        <h2>Players</h2>
        {console.log()}
      </div>
    );
  }
}

